@notice reduces position
 @dev two forms of frontrun attacks:
 1. Manipulting ticks before this transaction such that the system repays incorrectly
 this is mitigated via specifying min and max ticks
 2. regular swap frontruns
 this is mitigated by specifying minOutput of the swap
 @dev When current tick is inside borrowed range, can only reduce position using limit orders + fillers

@notice when a position can be force closed, system allows filler to close position and collect
 all remaining proceeds in return
 @dev filler needs to specify fillerPayAmount under his discretion,
 ideally it is the minimum amount he has to pay such that the AMM can be made whole, while maximizing his profit
 @dev when the trader's position is closed by this function he will no longer be entitled to his margin
 and the filler's (max) profit will be his remaining margin
 param fillerPayAmount denotes the amount the filler is willing to pay for the ENTIRE position
 @dev depending on the uniswap tick he might not get to buy the entire position but only a portion of it, at which
 the price he will buy the portion is the ratio fillerpayamount/totalPosition
